import React from 'react';
import { Grid, Paper, Typography } from '@mui/material';
import { PieChart, Pie, Cell, ResponsiveContainer, Legend, Tooltip } from 'recharts';

const Dashboard = () => {
  // Sample data for donut charts
  const firewallData = [
    { name: 'CPU Usage', value: 65 },
    { name: 'Free CPU', value: 35 },
  ];

  const switchData = [
    { name: 'Port Usage', value: 75 },
    { name: 'Free Ports', value: 25 },
  ];

  const serverData = [
    { name: 'Memory Usage', value: 60 },
    { name: 'Free Memory', value: 40 },
  ];

  // Updated color schemes for different chart types
  const FIREWALL_COLORS = ['#FF6B6B', '#4ECDC4']; // Red for usage, Teal for free
  const SWITCH_COLORS = ['#45B7D1', '#98E2F7'];    // Dark blue for usage, Light blue for free
  const SERVER_COLORS = ['#96C93D', '#DAF7A6'];    // Green for usage, Light green for free

  const renderDonutChart = (data, title, colors) => (
    <Paper sx={{ p: 2, height: '100%' }}>
      <Typography variant="h6" gutterBottom align="center">
        {title}
      </Typography>
      <ResponsiveContainer width="100%" height={250}>
        <PieChart>
          <Pie
            data={data}
            cx="50%"
            cy="50%"
            innerRadius={60}
            outerRadius={80}
            fill="#8884d8"
            paddingAngle={5}
            dataKey="value"
          >
            {data.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={colors[index % colors.length]} />
            ))}
          </Pie>
          <Tooltip />
          <Legend />
        </PieChart>
      </ResponsiveContainer>
    </Paper>
  );

  return (
    <Grid container spacing={3}>
      <Grid item xs={12}>
        <Typography variant="h4" gutterBottom>System Overview</Typography>
      </Grid>
      
      <Grid item xs={12} md={4}>
        {renderDonutChart(firewallData, 'Firewall CPU Usage', FIREWALL_COLORS)}
      </Grid>

      <Grid item xs={12} md={4}>
        {renderDonutChart(switchData, 'Switch Port Utilization', SWITCH_COLORS)}
      </Grid>

      <Grid item xs={12} md={4}>
        {renderDonutChart(serverData, 'Server Memory Usage', SERVER_COLORS)}
      </Grid>

      <Grid item xs={12}>
        <Paper sx={{ p: 2 }}>
          <Typography variant="h6" gutterBottom>Device Status</Typography>
          <Grid container spacing={2}>
            <Grid item xs={12} md={4}>
              <Typography>Firewall Status: Active</Typography>
              <Typography>Active Connections: 1,234</Typography>
            </Grid>
            <Grid item xs={12} md={4}>
              <Typography>Switch Status: Active</Typography>
              <Typography>Error Rate: 0.01%</Typography>
            </Grid>
            <Grid item xs={12} md={4}>
              <Typography>Server Status: Active</Typography>
              <Typography>Uptime: 15 days</Typography>
            </Grid>
          </Grid>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default Dashboard;
